// 입력 검색어 제안 기능 - API 호출 관련 함수
// suggestionService.js

// API 호출을 위한 함수
export const fetchSuggestions = async (searchText) => {
  try {
    const response = await fetch(`/api/suggestions?query=${searchText}`);
    const data = await response.json();
    return data; // 검색 제안 데이터
  } catch (error) {
    console.error("Fetching suggestions failed", error);
    return [];
  }
};
